column1:
nmcli can accepts both direct JSON configuration data and a file name containing the configuration. In the latter case the file is read and the contents is put into this property.

Examples: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column3:
nmcli kan acceptera både direkt JSON-konfigurationsdata och ett filnamn innehållandes konfigurationen. I det senare fallet läses filen in och innehållet läggs i denna egenskap.

Exempel: set team.config { "device": "team0", "runner": {"name": "roundrobin"}, "ports": {"eth1": {}, "eth2": {}} }
          set team.config /etc/my-team.conf

column1:
Usage: nmcli device set { ARGUMENTS | help }

ARGUMENTS := DEVICE { PROPERTY [ PROPERTY ... ] }
DEVICE    := [ifname] <ifname> 
PROPERTY  := { autoconnect { yes | no } |
             { managed { yes | no }

Modify device properties.

column3:
Användning: nmcli device set { ARGUMENT | help }

ARGUMENT := ENHET { EGENSKAP [ EGENSKAP … ] }
ENHET    := [ifname] <grnamn> 
EGENSKAP  := { autoconnect { yes | no } |
             { managed { yes | no }

Ändra egenskaper för enhet.

column1:
Usage: nmcli general { COMMAND | help }

COMMAND := { status | hostname | permissions | logging }

  status

  hostname [<hostname>]

  permissions

  logging [level <log level>] [domains <log domains>]

column3:
Användning: nmcli general { KOMMANDO | help }

KOMMANDO := { status | hostname | permissions | logging }

  status

  hostname [<värdnamn>]

  permissions

  logging [level <loggnivå>] [domains <loggdomäner>]

column1:
Usage: nmcli general status { help }

Show overall status of NetworkManager.
'status' is the default action, which means 'nmcli gen' calls 'nmcli gen status'

column3:
Användning: nmcli general status { help }

Visar allmän status för Nätverkshanteraren.
”status” är standardåtgärden, vilket betyder ”nmcli gen” anropar ”nmcli gen status”

column1:
Usage: nmcli networking { COMMAND | help }

COMMAND := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column3:
Användning: nmcli networking { KOMMANDO | help }

KOMMANDO := { [ on | off | connectivity ] }

  on

  off

  connectivity [check]

column1:
Usage: nmcli radio { COMMAND | help }

COMMAND := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column3:
Användning: nmcli radio { KOMMANDO | help }

KOMMANDO := { all | wifi | wwan }

  all | wifi | wwan [ on | off ]

column1:
Usage: nmcli radio all { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of all radio switches, or turn them on/off.

column3:
Användning: nmcli radio all { ARGUMENT | help }

ARGUMENT := [on | off]

Hämta statusen för alla radioväxlar eller slå på/av dem.

column1:
Usage: nmcli radio wifi { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of Wi-Fi radio switch, or turn it on/off.

column3:
Användning: nmcli radio wifi { ARGUMENT | help }

ARGUMENT := [on | off]

Hämta status för trådlösa radioväxeln eller slå på/av den.

column1:
Usage: nmcli radio wwan { ARGUMENTS | help }

ARGUMENTS := [on | off]

Get status of mobile broadband radio switch, or turn it on/off.

column3:
Användning: nmcli radio wwan { ARGUMENT | help }

ARGUMENT := [on | off]

Hämta status för mobila bredbandsradioväxeln eller slå på/av den.
